import React from 'react';
import { Link, useLocation } from 'react-router-dom'; 
import back from "../images/BACK.webp";
import '../components/main.css';
import { FaUser, FaEdit } from 'react-icons/fa';

const Header = () => {
    const location = useLocation();
    const formData = location.state?.formData || {
        name: 'John Doe',
        email: 'john.doe@example.com',
        languages: 'English',
        education: "Bachelor's Degree in Computer Science",
        specialization: 'Web Development',
        socialMedia: {
            twitter: 'https://twitter.com/johndoe',
            linkedin: 'https://linkedin.com/in/johndoe',
            github: 'https://github.com/johndoe'
        }
    };

    return (
        <div style={{ position: "relative", height: "810px", width: "100%" }}>
            <img 
                className='img' 
                src={back} 
                alt="Banner" 
            />
            <h1 className="text">
                Content Creator Profile
            </h1>
            <div className="details">
                <p><strong>Name:</strong> {formData.name}</p>
                <p><strong>Email:</strong> {formData.email}</p>
                <p><strong>Language:</strong> {formData.languages}</p>
                <p><strong>Education:</strong> {formData.education}</p>
                <p><strong>Specialization:</strong> {formData.specialization}</p>
                <div className="social-media">
                    <a href={formData.socialMedia.twitter} target="_blank" rel="noopener noreferrer">
                        <i className="fab fa-twitter"></i>
                    </a>
                    <a href={formData.socialMedia.linkedin} target="_blank" rel="noopener noreferrer">
                        <i className="fab fa-linkedin-in"></i>
                    </a>
                    <a href={formData.socialMedia.github} target="_blank" rel="noopener noreferrer">
                        <i className="fab fa-github"></i>
                    </a>
                </div>
            </div>
            <div className='profile-actions'>
                <Link to="/profile/edit" className="profile-edit">
                    <FaEdit /> {/* Edit icon */}
                </Link>
                <Link to="/profile/edit" className="profile-icon">
                    <FaUser /> {/* Profile icon */}
                </Link>
            </div>
        </div>
    );
};

export default Header;
